import React from 'react';
import { Routes, Route } from 'react-router-dom';
import HomePage from './HomePage'; // Importe seus componentes de página
import ProductPage from './ProductPage'; // Importe seus componentes de página
import './App.css';
import { Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/products" element={<ProductPage />} />
        {/* Adicione mais rotas conforme necessário */}
      </Routes>
    </div>
  );
}

export default App;

function NavBar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/products">Produtos</Link>
        </li>
        {/* Adicione mais links conforme necessário */}
      </ul>
    </nav>
  );
}
